import React from 'react';
import './Form.css';

const Form = ({ value, onChange, onCreate, onKeyPress, color, time }) => {
    console.log(time);
    return (
        <div className="form">
            <input value={value} onChange={onChange} onKeyPress={onKeyPress} style={{color}} time={time}/>
            {time}
            <div className="create-button" onClick={onCreate}>
                입력
            </div>
        </div>
    )
}

export default Form;
